import Colaborador from "../Colaborador"
import "./Time.css"

const Time = ({time, colaboradores, mudarCor})=>{
    function aoDeletar(){
        console.log("deletado")
    }
    return(
        colaboradores.length > 0 &&
        <section className="time" style={{backgroundColor: time.corPrimaria}}>
            <input onChange={event => mudarCor(event.target.value, time.nome)} type="color" className="colorSet"/>
            <h3 style={{borderColor: time.corSecundaria}}>{time.nome}</h3>
            <div className="colaboradores">
                {colaboradores.map(colaborador => <Colaborador corDeFundo={colaborador.corSecundaria} key={colaborador.nome} nome={colaborador.nome} cargo={colaborador.cargo} imagem={colaborador.imagem} onClick={aoDeletar} />)}
            </div>
        </section>
       
    )
}

export default Time
